The underlying problem is bug 99931, but we should try to avoid the IAE when dealing with IntersectionCastTypeBindings. The easiest solution I see is to use the same workaround in TypeBinding#getName() as already done in IntersectionCastTypeBinding#constantPoolName() and visible via TypeBinding#getKey(): Just pick one of the intersectingTypes. While this is not correct, it at least meets the expectation of callers (get a single identifier).

Verified for 4.5 M1 with build I20140804-2000

A note: After this bug fix, the resulting code looks like this:

